import React from 'react';
import '../../../styles/Header.css';

export default () => {
    return (
        <>
        <div>
           <div className="header">
            <nav className="navbar navbar-expand-lg head_brand">
                <a className="navbar-brand font-italic" href="google.com">Ad setting demo</a>
            </nav>
           </div>
        </div>
        </>
    )
}
